export default {
  filters: {
    statusFilter(vulnsRand) {
      const statusMap = {
        低危: 'success',
        中危: 'gray',
        高危: 'danger'
      }
      return statusMap[vulnsRand]
    }
  },
  data() {
    return {
      list: [],
      listLoading: true,
      pageSize: 10,
      total: 0,
      currentPage: 1,
      vulnsSelection: null
    }
  },
  created() {
    this.getAll()
  },
  methods: {
    getAll() {
      this.listLoading = true
      this.$http.get('/to-security', {
        page: this.currentPage - 1,
        size: this.pageSize
      }).then(response => {
        this.list = response.content
        this.total = response.totalElements
        this.listLoading = false
      })
    },
  }
}
